import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Table } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash } from "@fortawesome/free-solid-svg-icons";
import { faEdit } from "@fortawesome/free-solid-svg-icons";

function DisplayToDoList() {
  const [todos, setTodos] = useState([
    { id: "1", title: "Push your code to github", status: "Done" },
    { id: "2", title: "Email to your manager", status: "Pending" },
    { id: "3", title: "Report to senior", status: "Pending" },
  ]);

  const deleteTodo = (todo) => {
    setTodos(todos.filter((deletetodo) => deletetodo.id !== todo.id));
  };
  return (
    <div>
      <h3>TodoList</h3>
      <Table striped hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {todos.map((todolist) => {
            return (
              <tr>
                <td>{todolist.id}</td>
                <td>{todolist.title}</td>
                <td>{todolist.status}</td>
                <td>
                  <button
                    className="primarty"
                    onClick={() => deleteTodo(todolist)}
                  >
                    <FontAwesomeIcon icon={faTrash} />
                  </button>
                  <button>
                    <FontAwesomeIcon icon={faEdit} />
                  </button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    </div>
  );
}

export default DisplayToDoList;
